import PropTypes from 'prop-types'; 

const Filter = ({filter,changeFilter}) =>{
    return(
        <>
            <label htmlFor="">
                Find contact by name
            </label > <br/>
            <input
                onChange={changeFilter}
                value={filter}
                type="text"
                name="filter" />
        </>
    )
};
const propTypes = {
    filter: PropTypes.string.isRequired,
    changeFilter: PropTypes.func.isRequired,
};
export default Filter;
